import React from 'react';

import App from '../App';
import Footer from '../Footer';

import '../CV.css';

function CV() {
    return (
        <div id="cv">
            <App />
            <div class="cv">
                <h2>Education</h2>
                <p>
                    2021 - n/a, Codecademy, <i>Certification, Full-Stack Engineer</i><br/>
                    2020, University of Houston, <i>BS, Digital Media</i>
                </p>
            </div>
            <div class="cv">
                <h2>Experience</h2>
                <p>
                    2014 - n/a, <i>Graphic Design Freelancer</i><br/>

                </p>
            </div>
            <Footer />
        </div>
    )
}

export default CV;
